import { Map, GoogleApiWrapper } from 'google-maps-react';

import ReactDOM from 'react-dom';
// import * as ReactDOM from 'react-dom'

export class MapContainer extends Component {
    render() {
        const styles = {
          width: '100%',
          height: '100%'
        };
        return (
            <Map
                google={this.props.google}
                style={styles}
                zoom = {14}
                lat = {37.774929}
                lng = {-122.419416}
//                 initialCenter={{
//  lat: -1.2884,
//  lng: 36.8233
// }}
                center={{lat, lng}}
            />
        );
    }
}

